  [],\n\t\"num_tags\": 0,\n\t\"name\": \"moored-current-meter-data-collected-from-the-bering-sea-gulf-of-alaska-and-north-pacific-ocean-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Moored current meter data were collected
  from the Bering Sea, Gulf of Alaska, and North Pacific Ocean from February 16, 1994
  to May 25, 2002. Data were collected by the Pacific Marine Environmental Laboratory
  (PMEL) as part as part of the Fisheries-Oceanography Cooperative Investigations
  (FOCI). Current meter parameters include East/West velocity components (U), North/South
  velocity component (V), current speed, current direction, salinity, pressure, conductivity,
  and temperature. Data are not in standard formats and are self documenting.\",\n\t\"owner_org\":
